import { Component, Input } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { Product } from '../../models/product.interface';

@Component({
  selector: 'app-product-card',
  standalone: true,
  imports: [CommonModule, RouterModule],
  templateUrl: './product-card.component.html',
  styleUrls: ['./product-card.component.scss']
})
export class ProductCardComponent {
  @Input({ required: true }) product!: Product;

  get stockStatus(): { text: string; class: string } {
    if (this.product.quantity === 0) {
      return { text: 'Out of Stock', class: 'out-of-stock' };
    } else if (this.product.quantity < 10) {
      return { text: 'Low Stock', class: 'low-stock' };
    } else {
      return { text: 'In Stock', class: 'in-stock' };
    }
  }

  get formattedPrice(): string {
    return `$${this.product.price.toFixed(2)}`;
  }
}
<div class="product-card">
  <div class="product-header">
    <h3 class="product-name">{{ product.name }}</h3>
    <span class="stock-status" [class]="stockStatus.class">
      {{ stockStatus.text }}
    </span>
  </div>

  <div class="product-details">
    <div class="price-section">
      <span class="price">{{ formattedPrice }}</span>
      <span class="quantity">Qty: {{ product.quantity }}</span>
    </div>

    <div class="product-id">
      ID: {{ product.id }}
    </div>
  </div>

  <div class="product-actions">
    <button class="view-details-btn" [routerLink]="['/products', product.id]">
      View Details
    </button>
  </div>
</div>
